        {id: 7, firstName: 'Mark6', lastName: 'Jio6', address: 'Moscow', phone: '899954'}
      ]
    }
    return (
      <div className="col-10 bg-secondary px-5 pt-2">
        <h2 class="fas fa-h2 text-light font-weight-bold m-3">{table.name}</h2>
        <table class="table table-dark m-3">
    <thead>
      <tr>

        { Object.key(table.data[0]).map(key =>
            <th>{key}</th> 
        )}

      </tr>
    </thead>
    <tbody>
      <tr>
        <td>John</td>
        <td>Doe</td>
        <td>john@example.com</td>
      </tr>
      <tr>
        <td>Mary</td>
